import boto3
from botocore.client import Config
from uuid import uuid4
from base64 import b64decode
from io import BytesIO

s3 = boto3.resource("s3",
                    endpoint_url="http://169.254.146.101:9000",
                    config=Config(signature_version='s3v4'),
                    region_name='us-east-1')
class file_like_obj:
    def __init__(self, bytes_in_b64):
        self.stream = b64decode(bytes_in_b64)

    def read(self, *args, **kwargs):
        return self.stream

def new_media(muid, uid, type, bytes_in_b64):
    s3.Bucket(type).upload_fileobj(file_like_obj(bytes_in_b64), muid+'.png', ExtraArgs={"ACL": "public-read"})
    return "http://169.254.146.101:9000/images/"+muid+".png"


